 */
import React,{Component} from 'react'


class Action extends Component{
    render(){
        return(
            <div>
                Action
            </div>
        )
    }
}

class List extends Component{
    render(){
        return(
            <div>
                this.props.data
            </div>
        )
    }
}

class App extends Component{

    constructor(props){
        super(props)
        this.state = {
            data:['a','b','c']
        }
    }


    render(){
        return(
            <div>
                <Action/>
                <List />
            </div>
        )
    }
}

export default App
